import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import favicon from '../../assets/images/favicon.png'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'


const div = styled.div`
height: 100%;
margin: 0;
`

const MainWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  height: 400px;
  width: 100%;
  background-color: red;
`
const SubWrapper1 = styled.div`
  width: 40%;
  background-color : ${properties.white};
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 24px;
  /* @media (max-width: 990px) {
  padding-bottom: 24px;
  width: 70%;
} */
`
const SubCol1 = styled.div`
  width: 100px;
  height: 100px;
  background-image: url(${props => props.favicon});
  background-size: cover;


`

class Register extends Component {
  render() {
    return (<div>
      <Header />
      <HeaderDown />
      <MainWrapper >
        <SubWrapper1 >
          <SubCol1 favicon={favicon} />
        </SubWrapper1>



      </MainWrapper>

      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Register
